带宏参数的宏定义：
例如：
#define M(y)    (y)*(y)+3*(y)  //宏定义

//宏调用
k=M(5);

switch(表达式)
{
    case 整型数值1: 语句 1;
    case 整型数值2: 语句 2;
    ......
    case 整型数值n: 语句 n;
    default: 语句 n+1;
}
case 后面必须是一个整数，或者是结果为整数的表达式，但不能包含任何变量。且这个数必须互不相同。

do{
    语句块
}while(表达式);
注意最后的分号

for(表达式1; 表达式2; 表达式3){
    语句块
}

字符数组与字符串：
 char str[] = {"c.biancheng.net"};
char str[] = "c.biancheng.net";  
字符串总是以'\0'作为结尾，所以'\0'也被称为字符串结束标志，或者字符串结束符。

定义结构体：
struct 结构体名{
    结构体所包含的变量
};

在栈上定义结构体变量：
struct  结构体名   变量名{初始化赋值}

获取结构体变量的成员：
变量名.成员变量名

枚举：
enum typeName{ valueName1, valueName2, valueName3, ...... };
则自动有 valueName1=0,valueName2=1, valueName3=2，......

double strtod(const char *nptr,char **endptr);
会扫描nptr字符串，跳过前面的空格字符，直到遇上数字或正负符号才开始读取，到出现非数字或字符串结束时('\0')才结束读取，转换后结果返回。 若endptr不为NULL，则会将遇到不合条件而终止的nptr中的字符指针由endptr传回。
参数nptr字符串可包含正负号、小数点或E(e)来表示指数部分。如123.456或123e-2。

long int strtol(const char *nptr,char **endptr,int base)
将参数nptr字符串根据参数base来转换成长整型数。 参数base范围从2至36，或0。 参数base代表采用的进制方式，如base值为10则采用10进制，若base值为16则采用16进制等。 当base值为0时则是采用10进制做转换，但遇到如'0x'前置字符则会使用16进制做转换。
类似：unsigned long int strtoul(const char *nptr,char **endptr,int base);

char *strtok(char *str, const char *delim)
分解字符串 str 为两字符串，delim 为分隔符（分隔符不会包括在子字符串中）
返回指针指向前一个子字符串， 后一个子字符串”绑定“到该函数中，通过输入第一个参数为NULL便可继续分割。 如果没有可检索的字符串，则返回一个空指针。
例子： char str[] = "Hello this World "; char *a = " "; //空格为分隔符 char *b = strtok(str , a); // 第一次分割，此时b指向第一个子字符串"Hello"
while(b != NULL){
b = strtok( NULL , a ); //以NULL为参数，由于该函数已绑定子字符串，这样便可继续分割
}
//输出： Hello this world
